import { Link } from 'react-router-dom';
import logo from '../icons/logo.svg'; // Adjust path if needed

export default function Header() {
  return (
    <header className="bg-zinc-900 text-white p-4 shadow-md fixed top-0 w-full z-50">
      <div className="max-w-6xl mx-auto flex items-center justify-between">
        <Link to="/" className="flex items-center space-x-2">
          <img src={logo} alt="AS13.ai Logo" className="h-8 w-auto" />
          <span className="text-xl font-bold text-blue-500">AS13.ai</span>
        </Link>
        {/* Removed nav links */}
      </div>
    </header>
  );
}
